(23, 'ভালো কাজের ফল – শিক্ষামূলক গল্প', 'মোঃ আসাদুজ্জামান ', 'স্কটল্যান্ডের এক গরিব কৃষক। তার নাম ফ্লেমিং। একদিন তিনি জমিতে কাজ করছিলেন। হঠাৎ কাছের পুকুর থেকে চিৎকার ভেসে এলো, ‘বাঁচাও। বাঁ-চা-ও!’\r\n\r\nতিনি কাজ ফেলে ছুটে গেলেন। সেখানে একটি ছোট ছেলে পানিতে হাবুডুবু খাচ্ছে। পানিতে হাত নাড়ছে আর আতঙ্কে চিৎকার করছে। কৃষক ফ্লেমিং ছেলেটাকে উদ্ধার করলেন। নিশ্চিত মৃত্যুর হাত থেকে ছেলেটা রেহাই পেল।\r\n\r\nপরদিন সকালে একটা চমৎকার গাড়ি এসে থামল কৃষকের বাড়ির সামনে। মার্জিত পোশাক পরা এক ভদ্রলোক গাড়ি থেকে নেমে এলেন। কৃষক ফ্লেমিং যে ছেলেটিকে বাঁচিয়েছেন, ভদ্রলোক নিজেকে সেই ছেলেটির বাবা হিসেবে পরিচয় দিলেন।\r\n\r\n‘আমি আপনাকে প্রতিদান দিতে চাই। আপনি আমার ছেলের জীবন বাঁচিয়েছেন।’ ভদ্রলোক বললেন।\r\n\r\n‘না, আমি যা করেছি তার প্রতিদান নিতে পারব না। ক্ষমা করবেন।’ জবাব দিলেন সেই কৃষক। এমন সময় ঘর থেকে বেরিয়ে এলো তার ছেলে।\r\n\r\n‘এটা কি আপনার ছেলে?’ ভদ্রলোক জানতে চাইলেন।\r\n\r\nকৃষক গর্বের সঙ্গে জবাব দিলেন, ‘হ্যাঁ, এ আমার ছেলে।’\r\n\r\n‘আমি আপনাকে একটি প্রস্তাব দিতে চাই। আমার ছেলের মতো আপনার ছেলেকেও পড়ালেখা করানোর সুযোগ আমায় দিন। যদি আপনার সামান্য গুণও ওর মধ্যে থাকে\r\n\r\nতাহলে নিশ্চয় একদিন এমন বড় মানুষ হবে- আমরা সবাই তাকে নিয়ে গর্ব করব।’\r\n\r\nবাস্তবে সেটিই হল। কৃষক ফ্লেমিংয়ের ছেলেকে ভর্তি করানো হল সেরা স্কুলে। যথাসময়ে সেই ছেলেটি স্নাতক পাস করলেন লন্ডনের সেন্ট মেরিজ হসপিটাল মেডিকেল স্কুল থেকে। আর পেনিসিলিন আবিষ্কার করে সারা দুনিয়ায় তিনি পরিচিতি লাভ করলেন স্যার আলেকজান্ডার ফ্লেমিং হিসেবে।\r\n\r\nকয়েক বছর পরের কথা। পুকুর থেকে বাঁচানো ভদ্রলোকের সেই ছেলেটি নিউমোনিয়ায় মারাত্মকভাবে ভুগছিলেন। মর মর অবস্থা।\r\n\r\nসে সময়ে তার প্রাণ বাঁচল কিসে? সেই পেনিসিলিনে।\r\n\r\nসেই ভদ্রলোকের নাম কী? লর্ড রানডলফ চার্চিল।\r\n\r\nতার ছেলের নাম? স্যার উইস্টন চার্চিল।\r\n\r\nনীতিকথা : ভালো কাজের ফল অবশ্যই ভালো হয়।', 'good-job.jpg', '2022-08-23', '2022-09-30', '00:12', '2022-08-27', 0, 1, 1, 0, 0, 0),
(24, 'ভালো কাজের ফল – শিক্ষামূলক গল্প', 'মোঃ আসাদুজ্জামান', 'স্কটল্যান্ডের এক গরিব কৃষক। তার নাম ফ্লেমিং। একদিন তিনি জমিতে কাজ করছিলেন। হঠাৎ কাছের পুকুর থেকে চিৎকার ভেসে এলো, ‘বাঁচাও। বাঁ-চা-ও!’ তিনি কাজ ফেলে ছুটে গেলেন। সেখানে একটি ছোট ছেলে পানিতে হাবুডুবু খাচ্ছে। পানিতে হাত নাড়ছে আর আতঙ্কে চিৎকার করছে। কৃষক ফ্লেমিং ছেলেটাকে উদ্ধার করলেন। নিশ্চিত মৃত্যুর হাত থেকে ছেলেটা রেহাই পেল। পরদিন সকালে একটা চমৎকার গাড়ি এসে থামল কৃষকের বাড়ির সামনে। মার্জিত পোশাক পরা এক ভদ্রলোক গাড়ি থেকে নেমে এলেন। কৃষক ফ্লেমিং যে ছেলেটিকে বাঁচিয়েছেন, ভদ্রলোক নিজেকে সেই ছেলেটির বাবা হিসেবে পরিচয় দিলেন। ‘আমি আপনাকে প্রতিদান দিতে চাই। আপনি আমার ছেলের জীবন বাঁচিয়েছেন।’ ভদ্রলোক বললেন। ‘না, আমি যা করেছি তার প্রতিদান নিতে পারব না। ক্ষমা করবেন।’ জবাব দিলেন সেই কৃষক। এমন সময় ঘর থেকে বেরিয়ে এলো তার ছেলে। ‘এটা কি আপনার ছেলে?’ ভদ্রলোক জানতে চাইলেন। কৃষক গর্বের সঙ্গে জবাব দিলেন, ‘হ্যাঁ, এ আমার ছেলে।’ ‘আমি আপনাকে একটি প্রস্তাব দিতে চাই। আমার ছেলের মতো আপনার ছেলেকেও পড়ালেখা করানোর সুযোগ আমায় দিন। যদি আপনার সামান্য গুণও ওর মধ্যে থাকে তাহলে নিশ্চয় একদিন এমন বড় মানুষ হবে- আমরা সবাই তাকে নিয়ে গর্ব করব।’ বাস্তবে সেটিই হল। কৃষক ফ্লেমিংয়ের ছেলেকে ভর্তি করানো হল সেরা স্কুলে। যথাসময়ে সেই ছেলেটি স্নাতক পাস করলেন লন্ডনের সেন্ট মেরিজ হসপিটাল মেডিকেল স্কুল থেকে। আর পেনিসিলিন আবিষ্কার করে সারা দুনিয়ায় তিনি পরিচিতি লাভ করলেন স্যার আলেকজান্ডার ফ্লেমিং হিসেবে। কয়েক বছর পরের কথা। পুকুর থেকে বাঁচানো ভদ্রলোকের সেই ছেলেটি নিউমোনিয়ায় মারাত্মকভাবে ভুগছিলেন। মর মর অবস্থা। সে সময়ে তার প্রাণ বাঁচল কিসে? সেই পেনিসিলিনে। সেই ভদ্রলোকের নাম কী? লর্ড রানডলফ চার্চিল। তার ছেলের নাম? স্যার উইস্টন চার্চিল। \r\n\r\nনীতিকথা : ভালো কাজের ফল অবশ্যই ভালো হয়।', 'good-job.jpg', '2022-08-23', '2022-09-16', '00:14', '2022-08-23', 0, 1, 1, 0, 0, 0),
